
DROP DATABASE IF EXISTS TestData;
CREATE DATABASE TestData;
USE TestData;


create table Customers (
	CustomerID INT,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	DeliveryAddress VARCHAR(50),
	BillingAddress VARCHAR(50),
	Email VARCHAR(50),
	PhoneNo VARCHAR(50),
	PRIMARY KEY (CustomerID)
);

create table Staff (
	StaffID INT,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Address VARCHAR(50),
	Email VARCHAR(50),
	JobTitle VARCHAR(50),
	PhoneNo VARCHAR(50),
	DoB DATE,
	Salary INT,
	PRIMARY KEY (StaffID)
);

create table Suppliers (
	SupplierID INT,
	Name VARCHAR(50),
	Address VARCHAR(50),
	Email VARCHAR(50),
	PhoneNo VARCHAR(50),
	PRIMARY KEY (SupplierID)
);

create table Orders (
	OrderID INT,
	CustomerID INT,
	StaffID INT,
	OrderDate DATE,
	PRIMARY KEY (OrderID)
);

create table OrderItems (
	ItemID INT,
	StockID INT,
	OrderID INT,
	Quantity INT,
	PRIMARY KEY (ItemID)
);

create table Stock (
	StockID INT,
	SupplierID INT,
	UnitPrice INT,
	StockLevel INT,
	PRIMARY KEY (StockID)
);
